[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "BRCA1 human", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ensembl", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX dc: <http://purl.org/dc/terms/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>

SELECT DISTINCT ?gene ?label ?chromosome ?start ?end
WHERE {
  ?gene a obo:SO_0000704 ;
        rdfs:label ?label ;
        faldo:location ?location .
  ?location faldo:begin ?begin ;
            faldo:end ?end_pos .
  ?begin faldo:position ?start ;
         faldo:reference ?ref .
  ?end_pos faldo:position ?end .
  ?ref rdfs:label ?chromosome .

  FILTER(CONTAINS(LCASE(?label), "brca1"))
  FILTER(CONTAINS(?ref, "homo_sapiens"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1 AND human[organism]", "max_results": 5}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["7157"]}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1[Gene Name] AND Homo sapiens[Organism]", "max_results": 1}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["672"]}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>

SELECT ?locus_tag ?gene_symbol
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:gene "clpX" ;
        nuc:locus_tag ?locus_tag .
  FILTER(CONTAINS(STR(?gene), "CP036276.1"))
  OPTIONAL { ?gene nuc:gene ?gene_symbol }
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "MONDO:0007739", "route": "mondo,omim"}}, {"name": "mcp__togomcp__togoid_getRelation", "input": {"source": "mondo", "target": "omim"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mondo", "sparql_query": "PREFIX mondo: <http://purl.obolibrary.org/obo/MONDO_>
PREFIX oboInOwl: <http://www.geneontology.org/formats/oboInOwl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?omim_id ?label
WHERE {
  mondo:0007739 oboInOwl:hasDbXref ?omim_id .
  FILTER(CONTAINS(STR(?omim_id), "OMIM"))
  OPTIONAL { mondo:0007739 rdfs:label ?label }
}"}}]

[{"name": "mcp__togomcp__list_databases", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) as ?strains_with_genomes) (COUNT(?genome) as ?total_genomes)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?genome a schema:GenomeSequence ;
          schema:describesStrain ?strain .
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?seqDB (COUNT(DISTINCT ?strain) as ?strain_count) (COUNT(?genome) as ?genome_count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?genome a schema:GenomeSequence ;
          schema:describesStrain ?strain ;
          schema:fromSequenceDB ?seqDB .
}
GROUP BY ?seqDB
ORDER BY DESC(?genome_count)"}}]

[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "medgen"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "mondo"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "medgen"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mondo"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "medgen", "sparql_query": "PREFIX mo: <http://med2rdf/ontology/medgen#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?concept) as ?count)
FROM <http://rdfportal.org/dataset/medgen>
WHERE {
  ?concept a mo:ConceptID ;
      mo:mgconso ?bn .
  ?bn rdfs:seeAlso ?mondo .
  FILTER(STRSTARTS(STR(?mondo), "http://purl.obolibrary.org/obo/MONDO_"))
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ensembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ensembl", "sparql_query": "PREFIX terms: <http://rdf.ebi.ac.uk/terms/ensembl/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT (COUNT(?exon) as ?exon_count)
FROM <http://rdfportal.org/dataset/ensembl>
WHERE {
  ?transcript a terms:EnsemblTranscript ;
              dcterms:identifier "ENST00000357654" ;
              sio:SIO_000974 ?ordered_exon .
  ?ordered_exon sio:SIO_000628 ?exon .
}"}}]
